import "./Login.css"

function Login (props) {
    if (props.id == "login" || props.id == "signup") {
        return (
            <div className="login-formm">
                <form className="container">
                <h2>{props.id}</h2>
                    <div className="column">
                        <div className="six row">
                            <label>Username</label>
                        </div>
                    </div>
                </form>
            </div>
        )
    }
}

export default Login;
